import React from "react"
import ReactDOM from "react-dom"

const AppHeader = () => {
    return (
        <h1>My todo list</h1>
    )
}

const SearchPanel = () => {
    const searchText = 'Type here to search'
    return (
        <input placeholder={searchText} />
    )
}

const App = () => {

    return (
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    )
}

ReactDOM.render(<App />,
    document.getElementById('root'))
